          "message": "Update module github.com/HdrHistogram/hdrhistogram-go to v1.2.0 (#1466)\n\nThis PR contains the following updates:\n\n| Package | Change | Age | Confidence |\n|---|---|---|---|\n|\n[github.com/HdrHistogram/hdrhistogram-go](https://redirect.github.com/HdrHistogram/hdrhistogram-go)\n| `v1.1.2` -> `v1.2.0` |\n[![age](https://developer.mend.io/api/mc/badges/age/go/github.com%2fHdrHistogram%2fhdrhistogram-go/v1.2.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![confidence](https://developer.mend.io/api/mc/badges/confidence/go/github.com%2fHdrHistogram%2fhdrhistogram-go/v1.1.2/v1.2.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n\n---\n\n### Release Notes\n\n<details>\n<summary>HdrHistogram/hdrhistogram-go\n(github.com/HdrHistogram/hdrhistogram-go)</summary>\n\n###\n[`v1.2.0`](https://redirect.github.com/HdrHistogram/hdrhistogram-go/releases/tag/v1.2.0):\nVersion 1.2.0\n\n[Compare\nSource](https://redirect.github.com/HdrHistogram/hdrhistogram-go/compare/v1.1.2...v1.2.0)\n\n#### Version 1.2.0\n\nThis release is backward compatible with no breaking API changes, but\nincludes significant improvements beyond bug fixes: Go 1.23 support,\nmodernized dependencies, and critical timestamp handling fixes.\nThe Go version requirement has been updated to 1.23.0.\n\n##### Update Urgency: High\n\n**High** - Contains critical fixes for timestamp handling that may\naffect log accuracy. Users relying on HistogramLogWriter should update\npromptly.\n\n##### Bug Fixes\n\n- Fix HistogramLogWriter.OutputStartTime nanosecond conversion\n([#&#8203;54](https://redirect.github.com/HdrHistogram/hdrhistogram-go/issues/54))\n- Fix Log writer: ensure histogram timestamps survive serialization\nroundtrip.\n([#&#8203;51](https://redirect.github.com/HdrHistogram/hdrhistogram-go/issues/51))\n\n##### Maintenance\n\n- Update to Go 1.23, modernize dependencies, and fix linter issues\n([#&#8203;55](https://redirect.github.com/HdrHistogram/hdrhistogram-go/issues/55))\n- Modernize Go toolchain and CI GH actions\n([#&#8203;53](https://redirect.github.com/HdrHistogram/hdrhistogram-go/issues/53))\n\n##### New Contributors\n\n- [@&#8203;dkropachev](https://redirect.github.com/dkropachev) made\ntheir first contribution in\n[#&#8203;53](https://redirect.github.com/HdrHistogram/hdrhistogram-go/pull/53)\n\n**Full Changelog**:\n<https://github.com/HdrHistogram/hdrhistogram-go/compare/v1.1.2...v1.2.0>\n\n</details>\n\n---\n\n### Configuration\n\nðŸ“… **Schedule**: Branch creation - \"before 8am on Monday\" (UTC),\nAutomerge - At any time (no schedule defined).\n\nðŸš¦ **Automerge**: Disabled by config. Please merge this manually once you\nare satisfied.\n\nâ™» **Rebasing**: Whenever PR becomes conflicted, or you tick the\nrebase/retry checkbox.\n\nðŸ”• **Ignore**: Close this PR and you won't be reminded about this update\nagain.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/open-telemetry/otel-arrow).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiI0Mi4xNi4xIiwidXBkYXRlZEluVmVyIjoiNDIuMTkuNSIsInRhcmdldEJyYW5jaCI6Im1haW4iLCJsYWJlbHMiOlsiZGVwZW5kZW5jaWVzIl19-->\n\n---------\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>\nCo-authored-by: otelbot <197425009+otelbot@users.noreply.github.com>",
