          "distinct": true,
          "id": "3e3c88518549affb8932e96ee4b2214acbe9dd79",
          "message": "Columnar query engine optimization for attribute filtering (#1514)\n\ncloses #1505 \n\nIn the columnar query engine's filtering code, when we execute a filter\nfor attributes it's a three step process:\n\n1. `AttributeFilterExec` invokes the `PhysicalExpr` to get the rows in\nthe attributes record batch which were selected\n2. `AttributeFilterExec` creates a bitmap containing the parent_ids that\nwere selected (called id_mask)\n3. `FilterExec` creates a selection vector for the root record batch by\nmapping the ID column to what is contained in the id_mask\n\nHowever if there are multiple attribute filters, say `attributes[\"x\"] ==\n\"y\" and attributes[\"x2\"] == [\"y2\"]`, currently were `and`ing together\nthe selection vectors created in step 3\n\nThis PR adds an optimization where we combine the biitmaps bitmaps\ncreated in step 2, and avoid materializing one of the root selection\nvectors (step 3) for each binary expression involving attributes.\n\nThe code that performs the optimization is in a new type called\n`pipeline::filter::optimize::AttrsFilterCombineOptimizerRule`, which\nwill analyze the `Composite<FilterPlan>` and the\n`Composite<AttributeFilterPlan>`s it contains, and rearrange them into\nsomething more optimal.\n\nThis PR also adds a handful of new constructors and helper functions to\nsome of the planning types like `Composite` and `FilterPlan` which just\nmakes the planning code and the unit tests less verbose.\n\nSelected benchmark results for the filter expressions that would benefit\nfrom this optimization):\n```\nattr_or_attr_filter/batch_size/32\n                        time:   [8.6627 Âµs 8.6857 Âµs 8.7088 Âµs]\n                        change: [âˆ’4.3630% âˆ’3.9732% âˆ’3.5771%] (p = 0.00 < 0.05)\n                        Performance has improved.\nattr_or_attr_filter/batch_size/1024\n                        time:   [53.869 Âµs 53.980 Âµs 54.092 Âµs]\n                        change: [âˆ’7.3646% âˆ’7.1068% âˆ’6.8428%] (p = 0.00 < 0.05)\n                        Performance has improved.\nattr_or_attr_filter/batch_size/8192\n                        time:   [463.16 Âµs 463.83 Âµs 464.56 Âµs]\n                        change: [âˆ’7.2959% âˆ’7.0295% âˆ’6.7603%] (p = 0.00 < 0.05)\n                        Performance has improved.\n\nattr_and_attr_filter/batch_size/32\n                        time:   [2.9615 Âµs 2.9750 Âµs 2.9892 Âµs]\n                        change: [âˆ’14.047% âˆ’13.523% âˆ’13.012%] (p = 0.00 < 0.05)\n                        Performance has improved.\nattr_and_attr_filter/batch_size/1024\n                        time:   [14.695 Âµs 14.748 Âµs 14.813 Âµs]\n                        change: [âˆ’31.230% âˆ’30.908% âˆ’30.578%] (p = 0.00 < 0.05)\n                        Performance has improved.\nattr_and_attr_filter/batch_size/8192\n                        time:   [113.92 Âµs 114.05 Âµs 114.17 Âµs]\n                        change: [âˆ’38.969% âˆ’38.798% âˆ’38.625%] (p = 0.00 < 0.05)\n                        Performance has improved.\n\nattr_and_or_together_filter/batch_size/32\n                        time:   [5.5045 Âµs 5.5362 Âµs 5.5688 Âµs]\n                        change: [âˆ’21.192% âˆ’20.657% âˆ’20.108%] (p = 0.00 < 0.05)\n                        Performance has improved.\nattr_and_or_together_filter/batch_size/1024\n                        time:   [28.291 Âµs 28.360 Âµs 28.436 Âµs]\n                        change: [âˆ’33.380% âˆ’33.157% âˆ’32.905%] (p = 0.00 < 0.05)\n                        Performance has improved.\nattr_and_or_together_filter/batch_size/8192\n                        time:   [221.88 Âµs 222.10 Âµs 222.33 Âµs]\n                        change: [âˆ’37.038% âˆ’36.881% âˆ’36.724%] (p = 0.00 < 0.05)\n                        Performance has improved.\n  ```",
